import React from "react";
import {Appbar} from 'react-native-paper'
import { StyleSheet , Touchable} from "react-native";

function Headernav(props){

    const _handleSearcg = () => console.log('buscando');

    return(
        <Appbar.Header>
            <Appbar.Content title="Becas Colombia"/>
            <Appbar.Action icon={magnify} onPress={_handleSearcg}/>

        </Appbar.Header>   
    );
}

export default Headernav;

const styles = StyleSheet.create({
    bottom: {
      position: 'absolute',
      left: 0,
      right: 0,
      bottom: 0,
    },
  });
